Kylar went to the store to buy glasses f.content:
Kylar can group the glasses he wants to buy into pairs, to take advantage of the discount on every second glass. For every pair of glasses, one costs $5 and the other costs $5 * 0.6 = $3. Kylar will buy 8 pairs in total (16 glasses divided into 8 pairs).

The total cost of each pair of glasses is $5 + $3 = $8. Therefore, Kylar will need to pay $8 per pair * 8 pairs = $64 in total.

